import React from 'react';
import './App.css';
import { Layout,Header,Navigation,Content } from 'react-mdl';
//import Main from './components/main';
import { Link } from 'react-router-dom';
import { Section,SectionsSpy } from 'react-smart-sections';

function App() {
  return (
<div className="demo-big-content">
    <Layout>
    <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/">MyPortfolio</Link>} scroll>
    <SectionsSpy
        render={sections => (
          <div className="navigation">
            {sections.map(section => (
              <button
                onClick={section.scroll}
                className={section.active ? "isActive" : ""}
              >
                {section.name}
              </button>
            ))}
          </div>
        )}
      />
        </Header>

        <Content>
            <div className="page-content" />
            <Section name="Projects">Projects</Section>
                <Section name="About Me">About Me</Section>
                <Section name="Contact">Contact</Section>       
                 </Content>
    </Layout>
</div>
  );
}

export default App;
